import Axios from 'axios'
import React, { Component } from 'react'
import axios from 'axios'
export class WordCloud extends Component {

    onClickHandler = e => {
        axios.get('/wordcloud')
    }

    render() {
        return (
            <div>
                <button onClick={this.onClickHandler}>Generate Wordcloud</button>
            </div>
        )
    }
}

export default WordCloud
